import React, {useEffect, useState} from 'react';

 

// let sourceimage = ""
// let nameoftype = ""
// <label>{nameoftype}</label>
// <img  src={sourceimage} className="typeturbins" alt="Тип Турбіни"/>

const ElectricPowerGenerator = () => {
   const hro = 1000;

    const g = 9.81;
    const[Q, setQ] = useState()
    const[Н, setН] = useState()
    const[ηt, setηt] = useState()
    const[Pt, setPt] = useState()

   
    function calQ(e){setQ(e.target.value)}
    function calН(e){setН(e.target.value)}
    function calηt(e){
        setηt(e.target.value)}
        useEffect(()=> {
            setPt(Number(hro)*Number(g)*Number(Q)*Number(Н)*Number(ηt))
        },[ηt , hro , g , Q , Н ])

    return <>

    <h1 className="Formula№1Header" >Потужність, яка розвивається гідротурбіною <input  value= {Pt}  className="Formula№1Result" type="number" name="Pt" placeholder="Pt" readOnly/>  Вт</h1>
    
    <ul className="Formula№1Variables">
       <li> &rho; – густина води <input value = {hro}  className="hro" type="numeric" name="hro" readOnly placeholder="&rho; = 1000"/>кг/м<sup>3</sup> </li>
       <li> g – прискорення вільного падіння <input  value = {g} className="g" type="number" name="g" readOnly  placeholder="g=9.81" />м/c<sup>2</sup></li>
       <li> Q – витрата води <input value = {Q} onChange={calQ} className="Q" type="text" name="Q"  placeholder="Q" maxLength="4"  />л/с</li>
       <li> Н – робочий напір  <input  value = {Н} onChange={calН} className="eH" type="text" name="Н"  placeholder="Н" maxLength="4"  />м</li>
       <li> η<sub>T</sub> – повний ККД турбіни  <input  value =  {ηt} onChange={calηt}className="ηt" type="text" name="ηt" placeholder="ηT"/></li>
   </ul>

   <div className="Formula№1Formulas"> 
   <label> P<sub>т</sub> = {!ηt? <span>&rho;</span>:1000}  ⋅ 
   {!ηt? <span>g</span>:9.81}  ⋅ 
   {!Q? <span>Q</span>:Q}  ⋅
    {!Н? <span>Н</span>:Н}  ⋅ 
    {!ηt? <span>η <sub>T</sub></span>:ηt}</label>
       </div>
    
    
    </> 
 }


 export default ElectricPowerGenerator
